import React from 'react';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import './App.css';
import Login from './components/Login';
import Home from './components/Home';
import ControlDepartment from './components/ControlDepartment';
import Location from './components/Location';
import ControlEmployee from './components/ControlEmployee';
import Job from './components/Job';
import Dependent from './components/Dependent';
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path = '/' exact component= {Login}></Route>
          <Route path = '/home' exact component = {Home}></Route>
          <Route path = '/departments' exact component = {ControlDepartment}></Route>
          <Route path = '/locations' exact component = {Location}></Route>
          <Route path = '/employees' exact component = {ControlEmployee}></Route>
          <Route path = '/jobs' exact component = {Job}></Route>
          <Route path = '/dependents' exact component = {Dependent}></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
